    this.state = {
      open: true
    };
  }

  handleSelect(activeKey) {
    console.log("Activedd key is: ", activeKey);
    this.setState({ activeKey });
  }

  render() {
    console.log("ACTIVE KEY IS: ", this.state.activeKey);
    return (
     <ButtonGroup>
        <Button>Left</Button>
        <Button>Middle</Button>
        <Button>Right</Button>
      </ButtonGroup>
    );
  }
}


export default Navigation;
